#!/bin/bash
set -euo pipefail
cd /testbed

# Clean up Docker image build artifacts that can confuse test runners
# These are duplicate repo directories and Dockerfiles left from image creation
rm -rf /testbed/*__*.* /testbed/Dockerfile.* 2>/dev/null || true

# Restore ENTIRE test suite from embedded tarball
# The agent cannot run any tests because all test dirs were removed
# This script restores them for verification (runs after agent completes)
ALL_TESTS_TARBALL=""
if [ -n "$ALL_TESTS_TARBALL" ]; then
    echo "Restoring complete test suite for verification..."
    echo "$ALL_TESTS_TARBALL" | base64 -d | tar -xzf - -C /testbed
    if [ $? -eq 0 ]; then
        echo "Restored test suite"
    else
        echo "WARNING: Failed to restore test suite from tarball"
    fi
fi

# Ensure all files (including restored tests) are tracked by git
# This is needed for tests that check git history (e.g., docusaurus)
cd /testbed
git config user.email "test@test.com" 2>/dev/null || true
git config user.name "Test" 2>/dev/null || true
if [ -d /testbed/.git ]; then
    # Git repo exists, add any untracked files from restored test suite
    git add -A 2>/dev/null || true
    git commit -q -m "add restored tests" 2>/dev/null || true
    echo "Added restored files to git"
else
    # No git repo, create one
    git init -q
    git add -A
    git commit -q -m "init" 2>/dev/null || true
    echo "Initialized git repository"
fi

npm test -- --reporter spec > /tmp/out.txt 2>&1 || true
cat /tmp/out.txt

# Check if fail_to_pass tests now pass
# Uses the EXACT same parsing logic as swesmith_parsers.py / validation.py
python3 << 'INNERPY'
import json
import re
import sys

# =============================================================================
# SWE-smith compatible parsers (matches scripts/harbor/parsers/swesmith_parsers.py)
# =============================================================================

PASSED = "PASSED"
FAILED = "FAILED"

def strip_ansi(text):
    return re.compile(r"\x1B(?:[@-Z\\-_]|\[[0-?]*[ -/]*[@-~])").sub("", text)

def parse_log_jest(log):
    """Parse Jest test output."""
    status_map = {}
    log = strip_ansi(log)
    pattern = r"^\s*(||)\s(.+?)(?:\s\((\d+\s*m?s)\))?$"
    for line in log.split("\n"):
        match = re.match(pattern, line.strip())
        if match:
            symbol, test_name, _ = match.groups()
            if symbol == "":
                status_map[test_name] = PASSED
            elif symbol == "":
                status_map[test_name] = FAILED
    if not status_map:
        match = re.search(r"Tests:\s+(\d+)\s+passed(?:,\s+(\d+)\s+failed)?", log)
        if match:
            passed, failed = int(match.group(1)), int(match.group(2) or 0)
            for i in range(passed):
                status_map[f"test_{i+1}"] = PASSED
            for i in range(failed):
                status_map[f"test_fail_{i+1}"] = FAILED
    if status_map:
        has_fail = any(v == FAILED for v in status_map.values())
        status_map["jest_test_suite"] = FAILED if has_fail else PASSED
    return status_map

def parse_log_vitest(log):
    """Parse Vitest test output."""
    status_map = {}
    log = strip_ansi(log)
    for line in log.split("\n"):
        line = line.strip()
        if not line:
            continue
        # Verbose format: " file > suite > test"
        match = re.match(r"^([])\s+(?:TS\s+)?(.+?\s+>\s+.+?)(?:\s+(?:\()?[\d\.]+m?s(?:\))?)?$", line)
        if match:
            symbol, test_name = match.groups()
            if symbol == "":
                status_map[test_name.strip()] = PASSED
            elif symbol in ("", ""):
                status_map[test_name.strip()] = FAILED
            continue
        # File summary: " file.spec.ts (N tests)"
        match = re.match(r"^([])\s+(?:\w+\s+)?(.+?\.(?:spec|test|ts|js|tsx|jsx))\s+\((\d+)\s+tests?", line)
        if match:
            symbol, file_name, count = match.groups()
            for i in range(int(count)):
                status_map[f"{file_name}::test_{i}"] = PASSED if symbol == "" else FAILED
            continue
        # Simple format: " test name"
        match = re.match(r"^([])\s+(.+?)(?:\s+(?:\()?[\d\.]+m?s(?:\))?)?$", line)
        if match and not re.search(r"\(\d+\s+tests?\)", line):
            symbol, test_name = match.groups()
            if symbol == "":
                status_map[test_name.strip()] = PASSED
            elif symbol in ("", ""):
                status_map[test_name.strip()] = FAILED
    # Check for summary
    match = re.search(r"Tests\s+(\d+)\s+passed", log)
    if match:
        fail_match = re.search(r"(\d+)\s+failed", log)
        if fail_match and int(fail_match.group(1)) > 0:
            status_map["vitest_test_suite"] = FAILED
        elif int(match.group(1)) > 0:
            status_map["vitest_test_suite"] = PASSED
    elif status_map:
        has_fail = any(v == FAILED for v in status_map.values())
        status_map["vitest_test_suite"] = FAILED if has_fail else PASSED
    return status_map

def parse_log_mocha(log):
    """Parse Mocha test output."""
    status_map = {}
    log = strip_ansi(log)
    for line in log.split("\n"):
        line = line.strip()
        # Pass/fail symbols
        match = re.match(r"^\s*(||||-)\s(.+?)(?:\s\((\d+\s*m?s)\))?$", line)
        if match:
            symbol, test_name, _ = match.groups()
            if symbol in ("", ""):
                status_map[test_name] = PASSED
            elif symbol in ("", ""):
                status_map[test_name] = FAILED
        # Numbered failures
        elif re.match(r"^\d+\)", line):
            test_name = re.sub(r"^\d+\)\s*", "", line).strip()
            if test_name and not test_name.startswith("Error") and test_name not in status_map:
                status_map[test_name] = FAILED
    if not status_map:
        passed_match = re.search(r"(\d+)\s+passing", log)
        failed_match = re.search(r"(\d+)\s+failing", log)
        if passed_match:
            for i in range(int(passed_match.group(1))):
                status_map[f"test_{i+1}"] = PASSED
        if failed_match:
            for i in range(int(failed_match.group(1))):
                status_map[f"test_fail_{i+1}"] = FAILED
    if status_map:
        has_fail = any(v == FAILED for v in status_map.values())
        status_map["mocha_test_suite"] = FAILED if has_fail else PASSED
    return status_map

def parse_log_tap(log):
    """Parse TAP test output."""
    status_map = {}
    log = strip_ansi(log)
    for line in log.split("\n"):
        line = line.strip()
        match = re.match(r"^(ok|not ok)\s+\d+\s+(?:-\s+)?(.+?)(?:\s*#\s*(skip|todo|SKIP|TODO).*)?$", line)
        if match:
            status, test_name, directive = match.groups()
            if directive and directive.lower() in ["skip", "todo"]:
                continue
            status_map[test_name.strip()] = PASSED if status == "ok" else FAILED
    if not status_map:
        pass_match = re.search(r"^#\s*pass\s+(\d+)", log, re.MULTILINE)
        fail_match = re.search(r"^#\s*fail\s+(\d+)", log, re.MULTILINE)
        if pass_match:
            for i in range(int(pass_match.group(1))):
                status_map[f"test_{i+1}"] = PASSED
        if fail_match:
            for i in range(int(fail_match.group(1))):
                status_map[f"test_fail_{i+1}"] = FAILED
    if status_map:
        has_fail = any(v == FAILED for v in status_map.values())
        status_map["tap_test_suite"] = FAILED if has_fail else PASSED
    return status_map

def parse_log_ava(log):
    """Parse AVA test output."""
    status_map = {}
    log = strip_ansi(log)
    for line in log.split("\n"):
        line = line.strip()
        if line.startswith(" "):
            test_name = re.sub(r"\s+\(\d+\.?\d*m?s\)$", "", line[2:]).strip()
            if test_name:
                status_map[test_name] = PASSED
        elif line.startswith(" [fail]:"):
            test_name = re.split(r"\s+(Error:|Rejected)", line[9:])[0].strip()
            if test_name:
                status_map[test_name] = FAILED
        elif line.startswith(" "):
            status_map[line[2:].strip()] = FAILED
    if not status_map:
        passed = re.search(r"(\d+)\s+tests?\s+passed", log)
        failed = re.search(r"(\d+)\s+(?:tests?\s+)?failed", log)
        if passed:
            for i in range(int(passed.group(1))):
                status_map[f"test_{i+1}"] = PASSED
        if failed:
            for i in range(int(failed.group(1))):
                status_map[f"test_fail_{i+1}"] = FAILED
    if status_map:
        has_fail = any(v == FAILED for v in status_map.values())
        status_map["ava_test_suite"] = FAILED if has_fail else PASSED
    return status_map

def parse_log_borp(log):
    """Parse borp test output (Fastify)."""
    status_map = {}
    log = strip_ansi(log)
    for line in log.split("\n"):
        line = line.strip()
        if line.startswith(" "):
            test_name = re.sub(r"\s*\(\d+[\.\d]*m?s\)\s*$", "", line[2:]).strip()
            if test_name:
                status_map[test_name] = PASSED
        elif line.startswith(" "):
            test_name = re.sub(r"\s*\(\d+[\.\d]*m?s\)\s*$", "", line[2:]).strip()
            if test_name:
                status_map[test_name] = FAILED
    if not status_map:
        pass_match = re.search(r" pass\s+(\d+)", log)
        fail_match = re.search(r" fail\s+(\d+)", log)
        if pass_match:
            for i in range(int(pass_match.group(1))):
                status_map[f"test_{i+1}"] = PASSED
        if fail_match:
            for i in range(int(fail_match.group(1))):
                status_map[f"test_fail_{i+1}"] = FAILED
    if status_map:
        has_fail = any(v == FAILED for v in status_map.values())
        status_map["borp_test_suite"] = FAILED if has_fail else PASSED
    return status_map

def parse_log_lodash(log):
    """Parse lodash custom test output."""
    status_map = {}
    log = strip_ansi(log)
    for line in log.split("\n"):
        match = re.search(r"PASS:\s*(\d+)\s+FAIL:\s*(\d+)\s+TOTAL:", line)
        if match:
            passed, failed = int(match.group(1)), int(match.group(2))
            for i in range(passed):
                status_map[f"test_{i+1}"] = PASSED
            for i in range(failed):
                status_map[f"test_fail_{i+1}"] = FAILED
            status_map["lodash_all_tests"] = FAILED if failed > 0 else PASSED
            break
    if not status_map and ("test:main" in log or "test:fp" in log):
        crash_ind = ["SyntaxError", "ReferenceError", "TypeError", "Error:", "throw "]
        if any(x in log for x in crash_ind):
            status_map["lodash_all_tests"] = FAILED
    return status_map

def parse_log_nodeunit(log):
    """Parse nodeunit test output."""
    status_map = {}
    log = strip_ansi(log)
    for line in log.split("\n"):
        match = re.match(r"^Testing\s+(.+?)\.+(OK|FAIL|ERROR)$", line.strip())
        if match:
            test_name, st = match.groups()
            status_map[test_name] = PASSED if st == "OK" else FAILED
    if not status_map:
        passed = re.search(r">>\s*(\d+)\s+assertions?\s+passed", log)
        failed = re.search(r"(\d+)\s+(?:assertions?\s+)?failed", log)
        if passed:
            status_map["nodeunit_tests"] = PASSED
        if failed:
            status_map["nodeunit_tests"] = FAILED
    if status_map:
        has_fail = any(v == FAILED for v in status_map.values())
        status_map["nodeunit_test_suite"] = FAILED if has_fail else PASSED
    return status_map

PARSERS = {
    "jest": parse_log_jest,
    "vitest": parse_log_vitest,
    "mocha": parse_log_mocha,
    "tap": parse_log_tap,
    "node_test": parse_log_tap,
    "ava": parse_log_ava,
    "borp": parse_log_borp,
    "lodash_custom": parse_log_lodash,
    "nodeunit": parse_log_nodeunit,
}

def parse_by_framework(log, framework):
    """Parse using framework-specific parser."""
    parser = PARSERS.get(framework.lower())
    if parser:
        return parser(log)
    # Unknown - try all and pick best
    best, best_count = {}, 0
    for p in PARSERS.values():
        try:
            result = p(log)
            if len(result) > best_count:
                best, best_count = result, len(result)
        except:
            pass
    return best

def to_sets(status_map):
    """Convert status map to passing/failing sets."""
    passing = {k for k, v in status_map.items() if v == PASSED}
    failing = {k for k, v in status_map.items() if v == FAILED}
    return passing, failing

# =============================================================================
# Main verification logic
# =============================================================================

with open('/tests/config.json') as f:
    config = json.load(f)

fail_to_pass = set(config.get('FAIL_TO_PASS', []))
framework = config.get('framework', 'unknown')

if not fail_to_pass:
    print("WARNING: No FAIL_TO_PASS tests defined")
    open('/logs/verifier/reward.txt','w').write('0')
    sys.exit(1)

out = open('/tmp/out.txt').read()
status_map = parse_by_framework(out, framework)
passing_tests, failing_tests = to_sets(status_map)

print(f'Framework: {framework}')
print(f'Parsed {len(passing_tests)} passing tests, {len(failing_tests)} failing tests')

# Check which F2P tests are now passing
# A test is "truly passing" only if it's in passing AND NOT in failing
f2p_now_passing = fail_to_pass & passing_tests - failing_tests
f2p_still_failing = fail_to_pass & failing_tests
f2p_not_found = fail_to_pass - passing_tests - failing_tests

print(f'FAIL_TO_PASS tests:')
for test in sorted(f2p_now_passing):
    print(f'   {test} - now passing')
for test in sorted(f2p_still_failing):
    print(f'   {test} - still failing')
for test in sorted(f2p_not_found):
    print(f'  ? {test} - not found in output')

print(f'Summary: {len(f2p_now_passing)}/{len(fail_to_pass)} now passing')

if f2p_now_passing == fail_to_pass and len(f2p_still_failing) == 0:
    print('SUCCESS: All FAIL_TO_PASS tests are now passing!')
    open('/logs/verifier/reward.txt','w').write('1')
else:
    print(f'FAILURE: {len(fail_to_pass) - len(f2p_now_passing)} tests still failing or not found')
    open('/logs/verifier/reward.txt','w').write('0')
    sys.exit(1)
INNERPY
